import * as React from 'react';
import { Text, View, StyleSheet, ScrollView, TextInput, TouchableOpacity } from 'react-native';
import { NavigationContainer, useNavigation  } from '@react-navigation/native';
import Feather from "@expo/vector-icons/Feather";
import { LinearGradient } from 'expo-linear-gradient';
import Icon from '@mdi/react';
import { mdiEmoticonSickOutline } from '@mdi/js';
import { useState, useContext } from 'react';
import { RemedioContext } from './remedioContext';

export function StackTratamento(){

}

export function Tratamento() {
    const navigation = useNavigation()
    return (
        <View style={styles.container}>
            {/* <View style={styles.containerTitulo}>
                <Text style={styles.textoTitulo}> Tratamentos</Text>
            </View> */}
            <View style={styles.containerCorpo}>
                <View style={styles.containerIcons}>

                    <Icon path={mdiEmoticonSickOutline}
                        size={1.5}

                    />

                    <Feather
                        name="calendar"
                        size={30}
                        color="black"
                        style={styles.icons}
                    />


                </View>

                <View style={styles.containerDoencas}>
                    <Text style={styles.textoDoenca}> Gripe</Text>
                    <Text style={styles.textoDoenca} > 26/09</Text>
                </View>

                <View style={styles.containerDoencas}>
                    <Text style={styles.textoDoenca}> Gripe</Text>
                    <Text style={styles.textoDoenca} > 26/09</Text>
                </View>

            </View>

            <View style={styles.footerBotao}>
                <TouchableOpacity onPress={() => navigation.navigate('CadastroTratamento')}>

                    <LinearGradient
                        // Button Linear Gradient
                        colors={['#CDE4AD', '#97D8AE', '#78D1D2']}
                        style={styles.botaoPlus}>
                        <Feather
                            name="plus"
                            size={40}
                            color="white"

                        />
                    </LinearGradient>
                </TouchableOpacity>
            </View>
        </View >


    );

}

// =================== Cadastro =======================


let flag = true
let rem= ''
let opa

export function CadastroTratamento() {
    const navigation = useNavigation()
  

    return (
        <View style={styles.container}>
            <View style={styles.containerTitulo}>
                <Text style={styles.textoTitulo}> Adicionar</Text>
                <TouchableOpacity
                    style={styles.containerTitulo}
                    onPress={() =>
                        navigation.goBack()
                    }>
                    <Feather
                        name="arrow-left"
                        size={30}
                        color="white"
                    />
                </TouchableOpacity>
            </View>
            <View style={styles.containerCorpo}>
                <View style={styles.containerDoencas}>
                    <TextInput
                        multiline
                        numberOfLines={1}
                        blurOnSubmit
                        style={styles.input}
                        placeholder="Enfermidade"
                        onFocus={() => {
                            console.log('Focused on input');

                        }
                        }
                    />
                </View>

                <View style={styles.inputRemedios}>
                    <NovoRemedio />
                    {flag  && <NovoRemedio />}
                  

                </View>

                <View style={styles.containerDoencas}>
                    <TextInput
                        multiline
                        numberOfLines={2}
                        blurOnSubmit
                        style={styles.input}
                        placeholder="Data"
                        onFocus={() => {
                            console.log('Focused on input');

                        }
                        }
                    />
                </View>

            </View>

            <View style={styles.footerBotao}>
                <TouchableOpacity>

                    <LinearGradient
                        // Button Linear Gradient
                        colors={['#CDE4AD', '#97D8AE', '#78D1D2']}
                        style={styles.botaoPlus}>
                        <Feather
                            name="check-circle"
                            size={40}
                            color="white"

                        />
                    </LinearGradient>
                </TouchableOpacity>
            </View>
        </View >

    )
}

function NovoRemedio() {
    const {inputRemedio} = React.useContext(RemedioContext)
    console.log(oi)

        console.log('aaaa', flag, inputRemedio)

        console.log('bbbbb')
        return (
            <View style={styles.containerDoencas}>
                <TextInput
                    multiline
                    numberOfLines={2}
                 
                    style={styles.input}
                    value={inputRemedio}

                    // onChangeText={(texto) =>{
                    //     setInputRemedio(texto)
                        
                      
                    // }
                    // }
                    placeholder="RemÃ©dio(s)"
                    onFocus={() => {
                        console.log('Focused on input');
                        flag = true


                    }
                    }
                />
            </View>
        )

    }


    const styles = StyleSheet.create({
        geral: {
            width: '50%',
            height: '50%',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'space-between',
            gap: 10,
        },
        container: {
            flex: 1,
            // backgroundColor: "#C7FFCC",
            alignItems: "center",
            flexDirection: 'column',
    
            gap: 11,
        },
        containerTitulo: {
            width: '100%',
            height: '8%',
            backgroundColor: '#97D8AE',
            borderColor: '#97D8AE',
            borderWidth: 2,
            borderBottomLeftRadius: 20,
            borderBottomRightRadius: 20,
            // box-shadow: 0px 1px 8px rgba(85, 74, 74, 0.44);
            justifyContent: 'center'
        },
        textoTitulo: {
            fontStyle: 'normal',
            fontWeight: 700,
            fontSize: 20,
            lineHeight: 24,
            alignItems: 'center',
            textAlign: 'center',
            color: '#FFFFFF',
    
    
        },
        containerCorpo: {
            width: '100%',
            height: '80%',
            flexDirection: 'column'
    
        },
        containerIcons: {
            width: '100%',
            height: 40,
            flexDirection: 'row',
            justifyContent: 'space-evenly'
    
        },
        icons: {
            width: 30,
            height: 30
        },
        containerDoencas: {
            width: '100%',
            height: 70,
            borderWidth: 1,
            borderColor: '#97D8AE',
            flexDirection: 'row',
            justifyContent: 'space-evenly',
    
    
        },
        textoDoenca: {
            fontWeight: 700,
            fontSize: 20,
            lineHeight: 17,
            alignItems: 'center',
            textAlign: 'center',
            color: '#7D7070',
            paddingTop: 25,
    
        },
        footerBotao: {
            width: '100%',
            height: '5%',
            justifyContent: 'center',
            alignItems: 'flex-end',
            paddingRight: '10%'
        },
        botaoPlus: {
            borderRadius: 30,
            // backgroundColor: '#97D8AE'
        },
        input: {
            borderWidth: 2,
            borderColor: 'white',
            borderRadius: 16,
            color: 'black',
            width: 200,
            padding: 6,
            textAlign: 'center'
        },
        inputRemedios: {
            width: '100%',
            height: '60%',
            borderWidth: 1,
            borderColor: '#97D8AE',
            flexDirection: 'column',
    
        }
    
    
    
